// Footer.jsx
import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-gray-800 text-white">
      <div className="container mx-auto py-3 flex justify-center items-center gap-5">
        <a href="https://www.linkedin.com/in/rohan-saxena-ai/" target="_blank" rel="noopener noreferrer">
          <i className="fa-brands fa-linkedin text-2xl duration-300 hover:opacity-70 cursor-pointer"></i>
        </a>
        <a href="https://github.com/RohanSaxena2020" target="_blank" rel="noopener noreferrer">
          <i className="fa-brands fa-github-alt text-2xl duration-300 hover:opacity-70 cursor-pointer"></i>
        </a>
      </div>
    </footer>
  );
};

export default Footer;
